// src/utils/deploy-v2.ts
async function deploy(mudConfig, deployConfig) {
  const startTime = Date.now();
  const { worldContractName, namespace, postDeployScript } = mudConfig;
  const { profile, rpc, privateKey, priorityFeeMultiplier, debug } = deployConfig;
  const forgeOutDirectory = await getOutDirectory(profile);
  const provider = new ethers.providers.StaticJsonRpcProvider(rpc);
  const signer = new ethers.Wallet(privateKey, provider);
  let nonce = await signer.getTransactionCount();
  console.log("Initial nonce", nonce);
  let maxPriorityFeePerGas;
  let maxFeePerGas;
  setInternalFeePerGas(priorityFeeMultiplier);
  let promises = [];
  const blockNumber = Number(await cast(["block-number", "--rpc-url", rpc], { profile }));
  console.log("Start deployment at block", blockNumber);
  const worldPromise = {
    World: worldContractName ? deployContractByName(worldContractName) : deployContract(IWorld_default.abi, World_default.bytecode, "World")
  };
  const systemPromises = Object.keys(mudConfig.systems).reduce((acc, systemName) => {
    acc[systemName] = deployContractByName(systemName);
    return acc;
  }, {});
  const defaultModules = {
    // TODO: these only need to be deployed once per chain, add a check if they exist already
    CoreModule: deployContract(CoreModule_default.abi, CoreModule_default.bytecode, "CoreModule"),
    RegistrationModule: deployContract(
      RegistrationModule_default.abi,
      RegistrationModule_default.bytecode,
      "RegistrationModule"
    ),
    KeysWithValueModule: deployContract(
      KeysWithValueModule_default.abi,
      KeysWithValueModule_default.bytecode,
      "KeysWithValueModule"
    )
  };
  const modulePromises = mudConfig.modules.filter((module) => !defaultModules[module.name]).reduce((acc, module) => {
    acc[module.name] = deployContractByName(module.name);
    return acc;
  }, defaultModules);
  const contractPromises = { ...worldPromise, ...systemPromises, ...modulePromises };
  const WorldContract = new ethers.Contract(await contractPromises.World, IWorld_default.abi, signer);
  console.log(chalk2.blue("Installing core World modules"));
  await fastTxExecute(WorldContract, "installRootModule", [await modulePromises.CoreModule, "0x"]);
  await fastTxExecute(WorldContract, "installRootModule", [await modulePromises.RegistrationModule, "0x"]);
  console.log(chalk2.green("Installed core World modules"));
  if (namespace)
    await fastTxExecute(WorldContract, "registerNamespace", [toBytes16(namespace)]);
  const tableIds = {};
  promises = [
    ...promises,
    ...Object.entries(mudConfig.tables).map(async ([tableName, { fileSelector, schema, primaryKeys }]) => {
      console.log(chalk2.blue(`Registering table ${tableName} at ${namespace}/${fileSelector}`));
      tableIds[tableName] = toResourceSelector(namespace, fileSelector);
      const schemaTypes = Object.values(schema).map((abiOrUserType) => {
        const { schemaType } = resolveAbiOrUserType(abiOrUserType, mudConfig);
        return schemaType;
      });
      const keyTypes = Object.values(primaryKeys).map((abiOrUserType) => {
        const { schemaType } = resolveAbiOrUserType(abiOrUserType, mudConfig);
        return schemaType;
      });
      await fastTxExecute(WorldContract, "registerTable", [
        toBytes16(namespace),
        toBytes16(fileSelector),
        encodeSchema(schemaTypes),
        encodeSchema(keyTypes)
      ]);
      await fastTxExecute(WorldContract, "setMetadata(bytes16,bytes16,string,string[])", [
        toBytes16(namespace),
        toBytes16(fileSelector),
        tableName,
        Object.keys(schema)
      ]);
      console.log(chalk2.green(`Registered table ${tableName} at ${fileSelector}`));
    })
  ];
  promises = [
    ...promises,
    ...Object.entries(mudConfig.systems).map(
      async ([systemName, { fileSelector, openAccess, registerFunctionSelectors }]) => {
        console.log(chalk2.blue(`Registering system ${systemName} at ${namespace}/${fileSelector}`));
        await fastTxExecute(WorldContract, "registerSystem", [
          toBytes16(namespace),
          toBytes16(fileSelector),
          await contractPromises[systemName],
          openAccess
        ]);
        console.log(chalk2.green(`Registered system ${systemName} at ${namespace}/${fileSelector}`));
        if (registerFunctionSelectors) {
          const functionSignatures = await loadFunctionSignatures(systemName);
          const isRoot = namespace === "";
          await Promise.all(
            functionSignatures.map(async ({ functionName, functionArgs }) => {
              const functionSignature = isRoot ? functionName + functionArgs : `${namespace}_${fileSelector}_${functionName}${functionArgs}`;
              console.log(chalk2.blue(`Registering function "${functionSignature}"`));
              if (isRoot) {
                const worldFunctionSelector = toFunctionSelector(
                  functionSignature === "" ? { functionName: systemName, functionArgs } : { functionName, functionArgs }
                );
                const systemFunctionSelector = toFunctionSelector({ functionName, functionArgs });
                await fastTxExecute(WorldContract, "registerRootFunctionSelector", [
                  toBytes16(namespace),
                  toBytes16(fileSelector),
                  worldFunctionSelector,
                  systemFunctionSelector
                ]);
              } else {
                await fastTxExecute(WorldContract, "registerFunctionSelector", [
                  toBytes16(namespace),
                  toBytes16(fileSelector),
                  functionName,
                  functionArgs
                ]);
              }
              console.log(chalk2.green(`Registered function "${functionSignature}"`));
            })
          );
        }
      }
    )
  ];
  await Promise.all(promises);
  promises = [];
  for (const [systemName, { fileSelector, accessListAddresses, accessListSystems }] of Object.entries(
    mudConfig.systems
  )) {
    const resourceSelector = `${namespace}/${fileSelector}`;
    promises = [
      ...promises,
      ...accessListAddresses.map(async (address) => {
        console.log(chalk2.blue(`Grant ${address} access to ${systemName} (${resourceSelector})`));
        await fastTxExecute(WorldContract, "grantAccess(bytes16,bytes16,address)", [
          toBytes16(namespace),
          toBytes16(fileSelector),
          address
        ]);
        console.log(chalk2.green(`Granted ${address} access to ${systemName} (${namespace}/${fileSelector})`));
      })
    ];
    promises = [
      ...promises,
      ...accessListSystems.map(async (granteeSystem) => {
        console.log(chalk2.blue(`Grant ${granteeSystem} access to ${systemName} (${resourceSelector})`));
        await fastTxExecute(WorldContract, "grantAccess(bytes16,bytes16,address)", [
          toBytes16(namespace),
          toBytes16(fileSelector),
          await contractPromises[granteeSystem]
        ]);
        console.log(chalk2.green(`Granted ${granteeSystem} access to ${systemName} (${resourceSelector})`));
      })
    ];
  }
  await Promise.all(promises);
  promises = [];
  promises = [
    ...promises,
    ...mudConfig.modules.map(async (module) => {
      console.log(chalk2.blue(`Installing${module.root ? " root " : " "}module ${module.name}`));
      const resolvedArgs = await Promise.all(
        module.args.map((arg) => resolveWithContext(arg, { tableIds, systemAddresses: contractPromises }))
      );
      const values = resolvedArgs.map((arg) => arg.value);
      const types = resolvedArgs.map((arg) => arg.type);
      const moduleAddress = await contractPromises[module.name];
      if (!moduleAddress)
        throw new Error(`Module ${module.name} not found`);
      await fastTxExecute(WorldContract, module.root ? "installRootModule" : "installModule", [
        moduleAddress,
        abi.encode(types, values)
      ]);
      console.log(chalk2.green(`Installed${module.root ? " root " : " "}module ${module.name}`));
    })
  ];
  await Promise.all(promises);
  promises = [];
  const postDeployPath = path.join(await getScriptDirectory(), postDeployScript + ".s.sol");
  if (existsSync(postDeployPath)) {
    console.log(chalk2.blue(`Executing post deploy script at ${postDeployPath}`));
    await forge(
      [
        "script",
        postDeployScript,
        "--sig",
        "run(address)",
        await contractPromises.World,
        "--broadcast",
        "--rpc-url",
        rpc,
        "-vvv"
      ],
      {
        profile
      }
    );
  } else {
    console.log(`No script at ${postDeployPath}, skipping post deploy hook`);
  }
  console.log(chalk2.green("Deployment completed in", (Date.now() - startTime) / 1e3, "seconds"));
  return { worldAddress: await contractPromises.World, blockNumber };
  async function deployContractByName(contractName) {
    console.log(chalk2.blue("Deploying", contractName));
    const { abi: abi2, bytecode } = await getContractData(contractName);
    return deployContract(abi2, bytecode, contractName);
  }
  async function deployContract(abi2, bytecode, contractName, retryCount = 0) {
    try {
      const factory = new ethers.ContractFactory(abi2, bytecode, signer);
      console.log(chalk2.gray(`executing deployment of ${contractName} with nonce ${nonce}`));
      const deployPromise = factory.deploy({
        nonce: nonce++,
        maxPriorityFeePerGas,
        maxFeePerGas
      });
      promises.push(deployPromise);
      const { address } = await deployPromise;
      console.log(chalk2.green("Deployed", contractName, "to", address));
      return address;
    } catch (error) {
      if (debug)
        console.error(error);
      if (retryCount === 0 && error?.message.includes("transaction already imported")) {
        setInternalFeePerGas(priorityFeeMultiplier * 1.1);
        return deployContract(abi2, bytecode, contractName, retryCount++);
      } else if (error?.message.includes("invalid bytecode")) {
        throw new MUDError(
          `Error deploying ${contractName}: invalid bytecode. Note that linking of public libraries is not supported yet, make sure none of your libraries use "external" functions.`
        );
      } else if (error?.message.includes("CreateContractLimit")) {
        throw new MUDError(`Error deploying ${contractName}: CreateContractLimit exceeded.`);
      } else
        throw error;
    }
  }
  async function loadFunctionSignatures(contractName) {
    const { abi: abi2 } = await getContractData(contractName);
    return abi2.filter((item) => ["fallback", "function"].includes(item.type)).map((item) => {
      if (item.type === "fallback")
        return { functionName: "", functionArgs: "" };
      return { functionName: item.name, functionArgs: `(${item.inputs.map((arg) => arg.type).join(",")})` };
    });
  }
  async function fastTxExecute(contract, func, args, retryCount = 0) {
    const functionName = `${func}(${args.map((arg) => `'${arg}'`).join(",")})`;
    try {
      const gasLimit = await contract.estimateGas[func].apply(null, args);
      console.log(chalk2.gray(`executing transaction: ${functionName} with nonce ${nonce}`));
      const txPromise = contract[func].apply(null, [
        ...args,
        { gasLimit, nonce: nonce++, maxPriorityFeePerGas, maxFeePerGas }
      ]);
      promises.push(txPromise);
      return txPromise;
    } catch (error) {
      if (debug)
        console.error(error);
      if (retryCount === 0 && error?.message.includes("transaction already imported")) {
        setInternalFeePerGas(priorityFeeMultiplier * 1.1);
        return fastTxExecute(contract, func, args, retryCount++);
      } else
        throw new MUDError(`Gas estimation error for ${functionName}: ${error?.reason}`);
    }
  }
  async function getContractData(contractName) {
    let data;
    const contractDataPath = path.join(forgeOutDirectory, contractName + ".sol", contractName + ".json");
    try {
      data = JSON.parse(readFileSync(contractDataPath, "utf8"));
    } catch (error) {
      throw new MUDError(`Error reading file at ${contractDataPath}`);
    }
    const bytecode = data?.bytecode?.object;
    if (!bytecode)
      throw new MUDError(`No bytecode found in ${contractDataPath}`);
    const abi2 = data?.abi;
    if (!abi2)
      throw new MUDError(`No ABI found in ${contractDataPath}`);
    return { abi: abi2, bytecode };
  }
  async function setInternalFeePerGas(multiplier) {
    const feeData = await provider.getFeeData();
    if (!feeData.lastBaseFeePerGas)
      throw new MUDError("Can not fetch lastBaseFeePerGas from RPC");
    maxPriorityFeePerGas = feeData.lastBaseFeePerGas.eq(0) ? 0 : Math.floor(15e8 * multiplier);
    maxFeePerGas = feeData.lastBaseFeePerGas.mul(2).add(maxPriorityFeePerGas);
  }
}
function toBytes16(input) {
  if (input.length > 16)
    throw new Error("String does not fit into 16 bytes");
  const result = new Uint8Array(16);
  for (let i = 0; i < input.length; i++) {
    result[i] = input.charCodeAt(i);
  }
  for (let i = input.length; i < 16; i++) {
    result[i] = 0;
  }
  return result;
}
function toResourceSelector(namespace, file) {
  const namespaceBytes = toBytes16(namespace);
  const fileBytes = toBytes16(file);
  const result = new Uint8Array(32);
  result.set(namespaceBytes);
  result.set(fileBytes, 16);
  return result;
}
function toFunctionSelector({ functionName, functionArgs }) {
  const functionSignature = functionName + functionArgs;
  if (functionSignature === "")
    return "0x";
  return sigHash(functionSignature);
}
function sigHash(signature) {
  return ethers.utils.hexDataSlice(ethers.utils.keccak256(ethers.utils.toUtf8Bytes(signature)), 0, 4);
}

